# Structure for table "house_image"
#

DROP TABLE IF EXISTS `house_image`;
CREATE TABLE `house_image` (
  `PicID` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `ApartmentID` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '公寓id',
  `ImageUrl` varchar(255) NOT NULL DEFAULT '' COMMENT '图片路径',
  `IsDefault` tinyint(1) NOT NULL COMMENT '是否默认',
  `SourceUrl` varchar(255) NOT NULL COMMENT '图片源地址',
  `Status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '采集状态',
  PRIMARY KEY (`PicID`)
) ENGINE=MyISAM AUTO_INCREMENT=1000 DEFAULT CHARSET=utf8 COMMENT='公寓图片';

