#
# Structure for table "house_message"
#

DROP TABLE IF EXISTS `house_message`;
CREATE TABLE `house_message` (
  `MessageID` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `userID` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '用户ID',
  `ApartmentInfo` varchar(100) NOT NULL DEFAULT '' COMMENT '公寓名或地点',
  `CheckTime` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '入住时间',
  `Tenancy` varchar(10) NOT NULL DEFAULT '' COMMENT '租期',
  `OtherInfo` varchar(255) NOT NULL DEFAULT '' COMMENT '其他要求',
  `AddTime` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '留言时间',
  `Mobile` varchar(20) NOT NULL DEFAULT '' COMMENT '手机号',
  `Email` varchar(30) NOT NULL DEFAULT '' COMMENT '邮箱',
  `Status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '状态 0未查看 1已查看 2已回复',
  `Remark` varchar(255) NOT NULL DEFAULT '' COMMENT '备注',
  PRIMARY KEY (`MessageID`)
) ENGINE=MyISAM AUTO_INCREMENT=1000 DEFAULT CHARSET=utf8 COMMENT='留言表';

